import React, { Component } from 'react'
import './Account.css'
class Account extends Component {
    render() {
        return (
            <>
                <form>
                    <h1>Account Info</h1>
                       <p>Enter Your Name</p>
                       <input type='text' placeholder="First Name"/>
                       <p></p>
                </form>
            </>

        )
    }
}

export default Account
